const Card = ({ resData }) => {


  return (
  <div className='border border-red-500 w-[400px] h-[300px] flex m-5'>
     <h1>{resData.show.name}</h1> 
     
 
       
     {resData.show.image === null ? 
     <div>No image </div>: <img alt='nothing' 
     src={resData.show.image.medium} 
/> }
  
  



    </div>
  )
}

export default Card
